// -------------------------
// Background Engine
// -------------------------
const initBackground = () => {
    const canvas = el('canvas', { id: 'bg-canvas' });
    document.body.appendChild(canvas);
    const ctx = canvas.getContext('2d');
    let particles = [];
    const resize = () => { canvas.width = window.innerWidth; canvas.height = window.innerHeight; };
    window.addEventListener('resize', resize);
    resize();
    for(let i=0; i<70; i++) particles.push({
        x: Math.random() * canvas.width, y: Math.random() * canvas.height,
        vx: (Math.random() - 0.5) * 0.5, vy: (Math.random() - 0.5) * 0.5
    });
    const animate = () => {
        ctx.clearRect(0,0, canvas.width, canvas.height);
        ctx.fillStyle = THEME.secondary; ctx.strokeStyle = THEME.primary;
        particles.forEach((p, i) => {
            p.x += p.vx; p.y += p.vy;
            if(p.x < 0 || p.x > canvas.width) p.vx *= -1;
            if(p.y < 0 || p.y > canvas.height) p.vy *= -1;
            ctx.beginPath(); ctx.arc(p.x, p.y, 1.5, 0, Math.PI*2); ctx.fill();
            for(let j=i+1; j<particles.length; j++) {
                const dist = Math.hypot(p.x - particles[j].x, p.y - particles[j].y);
                if(dist < 180) {
                    ctx.globalAlpha = 1 - (dist/180); ctx.lineWidth = 0.8;
                    ctx.beginPath(); ctx.moveTo(p.x, p.y); ctx.lineTo(particles[j].x, particles[j].y); ctx.stroke();
                }
            }
        });
        requestAnimationFrame(animate);
    };
    animate();
};


