// Init
// -------------------------
const init = () => {
    initBackground();
    const root = el('div', { id: 'root' });
    root.append(Nav(), Hero(), Features(), Insights(), Privacy(), el('footer', {
        innerHTML: `<b></b><br><span style="opacity:0.4; font-size:0.8rem; letter-spacing: 2px;">COGNITRACK NEURAL  2026</span>`
    }, { padding: '100px', textAlign: 'center' }));
   
    document.body.appendChild(root);


    const obs = new IntersectionObserver((e) => {
        e.forEach(x => { if(x.isIntersecting) x.target.classList.add('visible'); });
    }, { threshold: 0.15 });
    document.querySelectorAll('section').forEach(s => obs.observe(s));
};


